import React, { useEffect, useState } from 'react';
import './About.css';

const AboutMe = () => {
  const [content, setContent] = useState('');

  useEffect(() => {
    fetch('./About.txt')
      .then(response => response.text())
      .then(data => setContent(data));
  }, []);

  return (
    <div className="about-me-container">
      <h2>About Me</h2>
      <pre>{content}</pre>
    </div>
  );
};

export default AboutMe;
